    false,nt"url": null,nt"notes": "This annual narrative report for Ottawa
    National Wildlife Refuge Complex outlines Refuge accomplishments during the 1993
    calendar year.  The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses the management plan, public participation, compliance with environmental
    and cultural resource mandates, research, and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, pest control, wilderness areas, and private
    lands. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds, waterbirds, shorebirds, raptors,
    game mammals, scientific collections, and marking and banding. The public uses of
    the Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, and wildlife observation. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, and computer systems. Cooperative programs
    and items of interest are provided at the end.",nt"license_title": "License
